--DROP STATEMENTS
DROP TABLE CAR_CRASH_TESTS;
DROP TABLE CAR_MODEL;
DROP TABLE CAR_BRAND;
DROP table CARS;

SET DEFINE OFF;
create table CARS (
    ID number,
    Brand VARCHAR(50),
    Model VARCHAR(50),
    Year VARCHAR(50),
    Starting_Price number,
    sold_units number
);
BEGIN
COMMIT;
END;
/


create table CAR_BRAND (
    BRAND_ID varchar2(8) PRIMARY KEY,
    Brand_NAME VARCHAR(50) NOT NULL
);
BEGIN
COMMIT;
END;
/



CREATE TABLE CAR_MODEL (
    MODEL_ID varchar2(8) PRIMARY KEY,
    BRAND_ID varchar2(8) NOT NULL,
    MODEL_NAME varchar2(50) NOT NULL,
    YEAR  number (4,0) NOT NULL,
    STARTING_PRICE NUMBER(8,0) NOT NULL,
    SOLD_UNITS number,
    CONSTRAINT CAR_MODEL_FK FOREIGN KEY (BRAND_ID) REFERENCES CAR_BRAND (BRAND_ID)
);

BEGIN
COMMIT;
END;
/

CREATE TABLE CAR_CRASH_TESTS (
    CRASH_ID varchar2(8) PRIMARY KEY,
    MODEL_ID varchar2(8) NOT NULL,
    TEST_DATE DATE DEFAULT SYSDATE NOT NULL ,
    TEST_RATING NUMBER(3,2) DEFAULT -1,
    CONSTRAINT CAR_CRASH_MODEL_FK FOREIGN KEY (MODEL_ID) REFERENCES CAR_MODEL (MODEL_ID)
);
BEGIN
COMMIT;
END;
/